import styled from "styled-components/native";
import Colors from "../../constants/colors";

const Container = styled.View`
  flex: 1;
  align-items: center;
  padding: 84px 47px;
  justify-content: center;
`;

const Title = styled.Text`
  font-weight: 600;
  font-size: 24px;
  text-align: center;
  color: ${Colors.lightGray300};
  margin-bottom: 16px;
`;

const Status = styled.Text`
  font-size: 16px;
  text-align: center;
  color: ${Colors.lightGray300};
`;

const Bold = styled.Text`
  font-weight: bold;
`;

const Gap = styled.View`
  padding-top: 8px;
`;

const StatusImage = styled.Image`
  width: 280px;
  height: 200px;
  margin: 50px 0;
`;

const UserName = styled.Text`
  font-weight: 500;
  font-size: 16px;
  text-align: center;
  color: ${Colors.lightGray300};
  margin-bottom: 40px;
`;

const ChangeAccount = styled.Text`
  width: 100%;
  text-align: right;
  text-decoration-line: underline;

  color: ${Colors.orange};
`;

const InputView = styled.View`
  height: 64px;
  width: 100%;
`;

const WrongKey = styled.Text`
  color: ${Colors.red}
  justify-content: flex-start;
`;

const KeyContainer = styled.View`
  width: 100%;
  display: flex;
  flex-direction: column;
`;
export default {
  Container,
  Title,
  Status,
  Bold,
  Gap,
  InputView,
  StatusImage,
  UserName,
  ChangeAccount,
  WrongKey,
  KeyContainer,
};
